// src/components/Honeycomb.js
import React from 'react';
import './honeycomb.css';

const Honeycomb = ({ data }) => {
  const generateCells = (count, difficulty, color) => {
    return Array.from({ length: count }, (_, index) => (
      <div key={`${difficulty}-${index}`} className={`honeycomb-cell ${difficulty}`} style={{ backgroundColor: color }}>
        <div className="difficulty">{difficulty}</div>
      </div>
    ));
  };

  return (
    <div className="honeycomb">
      {data.map((item) => generateCells(item.count, item.difficulty, item.color))}
    </div>
  );
};

export default Honeycomb;
